import './Canvas.css';
import { useState, lazy, Suspense } from 'react';
import { Transaction } from '../../models/transaction';
// import TransactionBubble from '../TransactionBubble/TransactionBubble';
const TransactionBubble = lazy(() => import('../TransactionBubble/TransactionBubble'))

function Canvas({ transactions = [] as Transaction[] }) {
    return (
        <div className='w-screen h-screen bg-coolgray400'>
            <div className='absolute bottom-2 right-2'>
                {/* <span className='text-2xl'>{ Object.keys(transactions).length }</span> */}
                <span className='text-2xl'>{ transactions.length }</span>
            </div>
            {transactions.map((t, i) => (
                <Suspense fallback={<div>{i}</div>}>
                    <TransactionBubble key={i} transaction={t} />
                </Suspense>
            ))}
            {/* {Object.entries(transactions).map(([key, transaction]) => (
                <TransactionBubble key={key} transaction={transaction as Transaction} />
            ))} */}
        </div>
    );
}

export default Canvas;
